First Sunday (2008) 

Verenigde Staten
Komedie / Misdaad
96 minuten

geregisseerd door David E. Talbert
met Ice Cube, Katt Williams en Tracy Morgan

Durell en LeeJohn zijn naast beste vrienden, stuntelende kleine criminelen. Ze vernemen dat ze snel $17.000 aan schuld moeten betalen, anders verliest Durell zijn zoontje. Wanhopig bedenken ze een plan om de plaatselijke kerk te beroven. Dit leidt er toe dat ze de nacht in het Huis van God moeten doorbrengen en meer te verduren krijgen dan ze verwacht hadden.
